import React, { useState, useEffect } from 'react';
import axios from 'axios';

const DoctorList = () => {
  const [doctors, setDoctors] = useState([]);

  useEffect(() => {
    const fetchDoctors = async () => {
      try {
        const response = await axios.get('/api/doctors'); // Assuming your backend API endpoint for fetching doctors is '/api/doctors'
        setDoctors(response.data);
      } catch (error) {
        console.error('Error fetching doctors:', error);
      }
    };

    fetchDoctors();
  }, []);

  return (
    <div>
      <h2>Doctors List</h2>
      <ul>
        {doctors.map(doctor => (
          <li key={doctor._id}>
            <div>
              <strong>Name:</strong> {doctor.name}
            </div>
            <div>
              <strong>Degree:</strong> {doctor.degree}
            </div>
            <div>
              <strong>Fees:</strong> {doctor.fees}
            </div>
            {/* Add more doctor details as needed */}
            <a href={`/doctor/${doctor._id}`}>View Profile</a>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default DoctorList;
